vbos = {}
GRID_SIZE = 2  # tessellation number of Flag


from OpenGL.arrays import vbo
from OpenGL.GL import *
import numpy as np

def load_vbos():
    '''
    Loads the mesh data to VBOs
    '''
    for k, (vv, vn) in meshes.items():
        vbos[k] = (vbo.VBO(np.array(vv, np.float32)),
                   vbo.VBO(np.array(vn, np.float32)),
                   len(vv))

    # create the element buffer for the Flag
    width, height = GRID_SIZE, GRID_SIZE
    indices = []
    for row in range(height-1): # Only runs once, so no numpy needed:
        if row % 2 == 0: # even rows
            for col in range(width):
                indices.append(col + row * width)
                indices.append(col + (row+1) * width)
        else: # odd rows
            for c in range(width-1):
                col = width-1-c
                indices.append(col + (row+1) * width)
                indices.append(col - 1 + + row * width)

    elements, xyzs, normals = glGenBuffers(3)
    glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, elements)
    glBufferData(GL_ELEMENT_ARRAY_BUFFER, np.array(indices, np.uint16), GL_STATIC_DRAW)
    glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, 0)
    element_count = len(indices)
    vbos["Grid"] = (xyzs, normals, element_count, elements)

def delete_vbos():
    for k, v in vbos.items():
        v = list(v)
        del v[2]
        glDeleteBuffers(len(v), v)

def dynamic_render(name, xyzs, normals):
    """
    Uploads xyzs and normals to the GPU and makes the draw call
    """
    buffer_xyzs, buffer_normals, element_count, buffer_elements = vbos[name]

    glEnableVertexAttribArray(0)
    glEnableVertexAttribArray(1)

    glBindBuffer(GL_ARRAY_BUFFER, buffer_xyzs)
    glBufferData(GL_ARRAY_BUFFER, xyzs, GL_STREAM_DRAW)
    glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 0, None)

    glBindBuffer(GL_ARRAY_BUFFER, buffer_normals)
    glBufferData(GL_ARRAY_BUFFER, normals, GL_STREAM_DRAW)
    glVertexAttribPointer(1, 3, GL_FLOAT, GL_FALSE, 0, None)

    glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, buffer_elements)

    glDrawElements(GL_TRIANGLE_STRIP, element_count, GL_UNSIGNED_SHORT, None)

    glBindBuffer(GL_ARRAY_BUFFER, 0)

    glEnableVertexAttribArray(0)
    glEnableVertexAttribArray(1)

def static_render(name):
    '''
    Makes the drow call for all static objects
    '''
    vv, vn, l = vbos[name]

    vv.bind()
    glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 0, None)
    vn.bind()
    glVertexAttribPointer(1, 3, GL_FLOAT, GL_FALSE, 0, None)

    glEnableVertexAttribArray(0)
    glEnableVertexAttribArray(1)

    glDrawArrays(GL_TRIANGLES, 0, l)

    glDisableVertexAttribArray(0)
    glDisableVertexAttribArray(1)

    glBindBuffer(GL_ARRAY_BUFFER, 0)

def bezier(a, da, b, db):
    '''
    Finds Points on a bezier surface with the left 8 points given by "flagpole"
    and the remaining 8 by the positions a and b als well as the direction da and db
    @returns: tuple(positions, normals) both will be of shape (GRID_SIZE, GRID_SIZE, 3)
    '''
    def cubicVec(x):
        v = np.zeros((4, *x.shape), np.float32)
        v[0, :] = 1.0
        v[1, :] = x
        v[2, :] = x*x
        v[3, :] = v[2, :]*x
        return v

    def diffVec(x): # derivative of cubic vector
        v = np.zeros((4, *x.shape), np.float32)
        v[0, :] = 0.0
        v[1, :] = 1.0
        v[2, :] = 2*x
        v[3, :] = 3*x*x
        return v

    proj = lambda a, b: b*np.dot(a, b)

    P = np.zeros((4,4,3), np.float32)

    P[0,0,:] = np.array([-1,-1,0], np.float32)
    P[0,1,:] = np.array([-1,0,0], np.float32)
    P[0,2,:] = np.array([-1,1,0], np.float32)
    P[0,3,:] = np.array([-1,2,0], np.float32)

    P[1,0,:] = np.array([0,-1,0], np.float32)
    P[1,1,:] = np.array([0,0,0], np.float32)
    P[1,2,:] = np.array([0,1,0], np.float32)
    P[1,3,:] = np.array([0,2,0], np.float32)

    P[2,0,:] = a+proj(da, a-b)
    P[2,1,:] = a
    P[2,2,:] = b
    P[2,3,:] = b+proj(db, b-a)

    P[3,0,:] = a+da
    P[3,1,:] = a+proj(da, a-P[1,1,:])
    P[3,2,:] = b+proj(db, b-P[1,2,:])
    P[3,3,:] = b+db

    Mb = np.array([
        [1, 0, 0, 0],
        [-3,3, 0, 0],
        [3,-6, 3, 0],
        [-1,3,-3, 1]
    ], np.float32)

    
    eijk = np.zeros((3, 3, 3))
    eijk[0, 1, 2] = eijk[1, 2, 0] = eijk[2, 0, 1] = 1
    eijk[0, 2, 1] = eijk[2, 1, 0] = eijk[1, 0, 2] = -1

    # The Positions on the surface S are biven by S = U^T * M_b * P * M_b^T * V
    # were M_b is given as Mb above, U and V are the cubic vectors of the asociated
    # variables and P is the matrix of control points
    A = np.einsum("ja,abk,ib->ijk", Mb, P, Mb)
    U, V = np.linspace(0.35, 0.67, GRID_SIZE), np.linspace(0.35, 0.67, GRID_SIZE)
    u, v = np.meshgrid(U, V)
    S = np.einsum("ilm,ijk,jlm->lmk", cubicVec(u), A, cubicVec(v))
    dSdu = np.einsum("ilm,ijk,jlm->lmk", diffVec(u), A, cubicVec(v))
    #dSdv = np.einsum("ilm,ijk,jlm->lmk", cubicVec(u), A, diffVec(v))
    #N = np.einsum("jik,lmj,lmk->lmi", eijk, dSdu, dSdv)

    N = dSdu

    #N = N.reshape(GRID_SIZE*GRID_SIZE, 3)
    #N = N / np.tile(np.linalg.norm(N, axis=1), 3).reshape(GRID_SIZE*GRID_SIZE, 3)
    #N = N.reshape(GRID_SIZE, GRID_SIZE, 3)

    return S, N